import React from 'react';
import '../styles/TestRuns.css';

const TestRuns = () => {
  return (
    <div className="test-runs">
      <div className="content">
        <h3>Test Runs</h3>
        <ul>
          <li>EDC 1.119 - By Laraib P. on 7/4/2024</li>
          <li>DSR/DSP - Release 1.119 - By Zainab T. on 7/4/2024</li>
          <li>Infra 1.119 - By Ameer A. on 7/3/2024</li>
        </ul>
      </div>
    </div>
  );
};

export default TestRuns;
